--
-- Table structure for table `t_data_blood_pressure`
--

DROP TABLE IF EXISTS `t_data_blood_pressure`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_data_blood_pressure` (
  `nibpID` varchar(64) NOT NULL COMMENT '无创血压记录ID',
  `associateID` varchar(64) NOT NULL COMMENT '关联userID和deviceID',
  `measureTime` datetime DEFAULT NULL COMMENT '测量时间',
  `Sys` int(5) DEFAULT NULL COMMENT '收缩压（单位：mmHg 有效范围：0~300 有效精度：1）一般和Dia一起表示为120/75mmHg',
  `Dia` int(5) DEFAULT NULL COMMENT '舒张压（单位：mmHg 有效范围：0~300 有效精度：1）',
  `ABI` double DEFAULT NULL COMMENT '踝肱指数（需拼接底层数据）',
  `ABIFlag` tinyint(1) DEFAULT NULL COMMENT '踝肱指数标记（0：踝肱指数未开启 1：肱部血压 2：踝部血压）',
  `PR` int(5) DEFAULT NULL COMMENT '脉搏（单位：bpm 有效范围：10~400 有效精度：1）',
  `upload` tinyint(1) DEFAULT NULL COMMENT '是否上传',
  `RES` varchar(64) DEFAULT NULL COMMENT '保留字节',
  `creatTime` datetime DEFAULT NULL COMMENT '记录创建时间',
  `describtion` text COMMENT '保留字段',
  `deleteFlag` tinyint(1) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`nibpID`),
  KEY `associateID` (`associateID`),
  CONSTRAINT `t_data_blood_pressure_ibfk_1` FOREIGN KEY (`associateID`) REFERENCES `t_user_associate_device` (`associateID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

